    //props.isAdmin
    
    return (
        <>
            <NavBar/>
            <h1><b><u>{props.titre}</u></b></h1>
            {ImageWord(props.page, false)}
            {ImageWord(props.page + "Quiz", true)}

        </>
    )
}
